    //CONTACTS VALIDATION
    function alertContacts(firstName, lastName, contactNo){

        let isContactNumberValid = false;

        let numbers = "1234567890";
        for (let i = 0; i < contactNo.length; i++) {
            let isANumber = contactNo.includes(numbers[i]);
                if(isANumber)
                    isContactNumberValid = true;
                else{
                    isContactNumberValid = false;
                    break;
                }
        }

        if(firstName.length == 0 || lastName.length == 0 || contactNo.length == 0){
            alertMessage("Please Input all fields");
            return false;

        }else if(firstName.length < 2){
            alertMessage("First name must have more than 2 characters");
            return false;

        }else if(lastName.length < 2){
            alertMessage("Last name must have more than 2 characters");
            return false;

        }else if(contactNo.length < 3){
            alertMessage("Invalid Contact Number: Too Short");
            return false;
        
        }else{
            alertMessage("Success");
            return true;
        }
    }

